import styled from 'styled-components';

export const CatAdminPageStyled = styled.div`
  margin: 20px;

  .admin__cat-container {
    display: flex;

    .admin__cat-container__button-container {
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column;
    }
  }


`;
